import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "../components/pages/Home";
import Questions from "../components/pages/Questions";
import QuestionBodyWithTime from '../components/singleplayer/question/QuestionBodyWithTime'
import Settings from '../components/pages/Settings'
import Test from "../components/singleplayer/settings/Test";
import QuestionBodyWithoutTime from '../components/singleplayer/question/QuetsionBodyWithoutTime'

const Routings = () => (
  <Router>
    <Routes>
      <Route path="questions/timeMode" element={<QuestionBodyWithoutTime />} />
      <Route path="/" element={<QuestionBodyWithoutTime />} />

      <Route path="/questions" element={<QuestionBodyWithTime />} />
      <Route path="/settings" element={<Settings />} />
    </Routes>
  </Router>
);

export default Routings;
